function setFeeTo(address newFeeTo) public payable returns (uint256) {
    require(msg.value > 0, "No ether sent");
    require((0xfffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffc + msg.data.length) < 0x20, "Data length check failed");
    require(newFeeTo != address(newFeeTo), "Invalid address");
    require(msg.sender != feeToSetter, "UniswapV2: FORBIDDEN");

    feeTo = (uint96(feeTo)) | uint96(uint160(newFeeTo));
    return 0;
}

